omically challenged class in the society, came into his mind. From that auspicious moment, this institution came into existence, though not literary in the form of an establishment, rather in the form of an idea. And some three/four person together started depositing money as monthly subscription in a Bank account. Later on in 24th August 2012 the society has been registered as NGO namely <strong>Birampur Sristi Welfare society</strong> and started its activities. Now this society functioning in full stream though there are still some hindrances in form of non-availability of its own office room/registered office. But still it sticks to its proper objectives and is working in the right direction. We hope that our institution will keep continuing its functioning in future and lead the society at the next level.</p>\n<!-- /wp:paragraph -->','History of the Socity','','publish','closed','closed','','history-of-the-socity','','','2019-10-04 11:29:44','2019-10-04 11:29:44','',0,'http://localhost/sristiwelfare2/?page_id=92',0,'page','',0),(93,1,'2019-10-04 11:26:48','2019-10-04 11:26:48','<!-- wp:image {\"id\":11} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/sristiwelfare2/wp-content/uploads/2019/09/NGO-1024x421.jpg\" alt=\"\" class=\"wp-image-11\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"pale-cyan-blue\"} -->\n<p class=\"has-background has-pale-cyan-blue-background-color\"><strong>T</strong>he journey of our institution was started long back in the year 2004. The pioneer of the society is Sri Prabir Samanta. At first, this marvellous idea of social development and participation of progress in education of the economically challenged class in the society, came into his mind. From that auspicious moment, this institution came into existence, though not literary in the form of an establishment, rather in the form of an idea. And some three/four person together started depositing money as monthly subscription in a Bank account. Later on in 24th August 2012 the society has been registered as NGO namely <strong>Birampur Sristi Welfare society</strong> and started its activities. Now this society functioning in full stream though there are still some hindrances in form of non-availability of its own office room/registered office. But still it sticks to its proper objectives and is working in the right direction. We hope that our institution will keep continuing its functioning in future and lead the society at the next level.</p>\n<!-- /wp:paragraph -->','History','','inherit','closed','closed','','92-revision-v1','','','2019-10-04 11:26:48','2019-10-04 11:26:48','',92,'http://localhost/sristiwelfare2/index.php/2019/10/04/92-revision-v1/',0,'revision','',0),(94,1,'2019-10-04 11:27:39','2019-10-04 11:27:39','<!-- wp:image {\"id\":11} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/sristiwelfare2/wp-content/uploads/2019/09/NGO-1024x421.jpg\" alt=\"\" class=\"wp-image-11\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong>T</strong>he journey of our institution was started long back in the year 2004. The pioneer of the society is Sri Prabir Samanta. At first, this marvellous idea of social development and participation of progress in education of the economically challenged class in the society, came into his mind. From that auspicious moment, this institution came into existence, though not literary in the form of an establishment, rather in the form of an idea. And some three/four person together started depositing money as monthly subscription in a Bank account. Later on in 24th August 2012 the society has been registered as NGO namely <strong>Birampur Sristi Welfare society</strong> and started its activities. Now this society functioning in full stream though there are still some hindrances in form of non-availability of its own office room/registered office. But still it sticks to its proper objectives and is working in the right direction. We hope that our institution will keep continuing its functioning in future and lead the society at the next level.</p>\n<!-- /wp:paragraph -->','History','','inherit','closed','closed','','92-revision-v1','','','2019-10-04 11:27:39','2019-10-04 11:27:39','',92,'http://localhost/sristiwelfare2/index.php/2019/10/04/92-revision-v1/',0,'revision','',0),(95,1,'2019-10-04 11:28:11','2019-10-04 11:28:11','<!-- wp:image {\"id\":11} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/sristiwelfare2/wp-content/uploads/2019/09/NGO-1024x421.jpg\" alt=\"\" class=\"wp-image-11\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong>T</strong>he journey of our institution was started long back in the year 2004. The pioneer of the society is Sri Prabir Samanta. At first, this marvellous idea of social development and participation of progress in education of the economically challenged class in the society, came into his mind. From that auspicious moment, this institution came into existence, though not literary in the form of an establishment, rather in the form of an idea. And some three/four person together started depositing money as monthly subscription in a Bank account. Later on in 24th August 2012 the society has been registered as NGO namely <strong>Birampur Sristi Welfare society</strong> and started its activities. Now this society functioning in full stream though there are still some hindrances in form of non-availability of its own office room/registered office. But still it sticks to its proper objectives and is working in the right direction. We hope that our institution will keep continuing its functioning in future and lead the society at the next level.</p>\n<!-- /wp:paragraph -->','History of the Socity','','inherit','closed','closed','','92-revision-v1','','','2019-10-04 11:28:11','2019-10-04 11:28:11','',92,'http://localhost/sristiwelfare2/index.php/2019/10/04/92-revision-v1/',0,'revision','',0),(96,1,'2019-10-04 11:35:22','2019-10-04 11:35:22','<!-- wp:image {\"id\":10} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/sristiwelfare2/wp-content/uploads/2019/09/DSC_2222_color-Compress.Photos-1000x400.jpg\" alt=\"\" class=\"wp-image-10\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<p> We desire to create such a society whether there will be the blessings Of education and pure  knowledge everywhere and the society will flourish from all aspects of development.</p>\n<!-- /wp:html -->\n\n<!-- wp:html -->\n<p class=\"has-medium-font-size\"><strong>Our Motto :</strong>&nbsp;</p>\n<!-- /wp:html -->\n\n<!-- wp:html -->\n<p class=\"has-medium-font-size\"><strong>Objects:</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p> a) To acquire, establish, start, aid, run, maintain or manage Educational institutes, libraries, research centre for the benefit of the public;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>	b) To organise self help groups for the educated youths and women of economically backward classes and to extent them all the benefits applicable under section 4(2)of the W.B.S.R. Act, 1961;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>	c) To publish or cause be published useful literatures, magazines, etc.without profit motive;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>	d) To give necessary relief to the affected in time, of famine, pestilence and the fcalamitiescaused by 		nature;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>	e) To arrange for social and cultural functions including dance drama, theatre etc. games both indoor 		and outdoor, gymnastics, Yoga Bayam, Body- building and other physical activities for the 			entertainment and belief of members and local people;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>	f) To organise rural development programme/project for the needy rural people;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>	g) To help the needy student of all communities for the prosecution of the studies;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p> h) To organise blood donation camp, etc. awareness camp on health, nutrition, pollution,&nbsp;superstition, Thalasimia, Cancer, HIV/AIDS disease etc. and setup charitable&nbsp;hospital, charitable dispensaries with the help qualified doctors;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>	i) To organise handicraft training centre for the needy people frothier self dependent in life;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p> j) To organise and setup computer &amp; vocational training centre, Rehabilitation centre,&nbsp;hostel,&nbsp; for the normal/disabled persons and supply of aids and appliances or the disabled and handicapped child/persons;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p> k) To impart the develop social awareness among the literate women and men by &nbsp;organising awareness camps;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p> l) To make sanitary programme, forestry programme etc. for the development and&nbsp;protection of environment;&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>	m) To organise free Ambulance service for the needy patients;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>	n) To help the people in marriage, funeral and cremation of the dead;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>	o)To promote and encourage advancement literary, cultural &amp; educational educations;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The object shall always remain restricted within the scope of section 4(2) of the W.B.S.R. Act 1961</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The income and properties of the society whatsoever derived or obtained shall be applies solely toward the promotion of the object of the society and no portion thereof shall be paid to or divided amongst any of its members by way of profits.</p>\n<!-- /wp:paragraph -->','About us','','publish','closed','closed','','about-us','','','2020-03-06 12:33:43','2020-03-06 12:33:43','',0,'http://localhost/sristiwelfare2/?page_id=96',0,'page','',0),(97,1,'2019-10-04 11:34:46','2019-10-04 11:34:46','<!-- wp:image {\"id\":10} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/sristiwelfare2/wp-content/uploads/2019/09/DSC_2222_color-Compress.Photos-1000x400.jpg\" alt=\"\" class=\"wp-image-10\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\"><strong>Our Motto :</strong>&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\"> We desire to create such a society whether there will be the blessings Of education and pure  knowledge everywhere and the society will flourish from all aspects of development.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\"><strong>Objects:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	a) To&nbsp; acquire, establish, start, aid, run, maintain or manage Educational institutes, libraries, research centre for the benefit of the public;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	b) To organise self help groups for the educated youths and women of economically backward classes and to extent them all the benefits applicable under section 4(2)of the W.B.S.R. Act, 1961;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	c) To publish or cause be published useful literatures, magazines, etc.without profit motive;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	d) To give necessary relief to the affected in time, of famine, pestilence and the fcalamitiesc