:06','',0,'http://localhost/sristiwelfare2/?p=233',3,'nav_menu_item','',0),(234,1,'2020-01-22 18:11:00','2020-01-22 18:11:00','','Home','','publish','closed','closed','','home','','','2020-01-22 18:13:06','2020-01-22 18:13:06','',0,'http://localhost/sristiwelfare2/?p=234',1,'nav_menu_item','',0),(235,1,'2020-01-22 18:11:45','2020-01-22 18:11:45','','Social Activity','','publish','closed','closed','','social-activity','','','2020-01-22 18:13:06','2020-01-22 18:13:06','',0,'http://localhost/sristiwelfare2/?p=235',4,'nav_menu_item','',0),(240,1,'2020-03-06 10:16:01','2020-03-06 10:16:01','<!-- wp:image {\"id\":10} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/sristiwelfare2/wp-content/uploads/2019/09/DSC_2222_color-Compress.Photos-1000x400.jpg\" alt=\"\" class=\"wp-image-10\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\"><strong>Our Motto :</strong>&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p> We desire to create such a society whether there will be the blessings Of education and pure  knowledge everywhere and the society will flourish from all aspects of development.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\"><strong>Objects:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	a) To&nbsp; acquire, establish, start, aid, run, maintain or manage Educational institutes, libraries, research centre for the benefit of the public;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	b) To organise self help groups for the educated youths and women of economically backward classes and to extent them all the benefits applicable under section 4(2)of the W.B.S.R. Act, 1961;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	c) To publish or cause be published useful literatures, magazines, etc.without profit motive;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	d) To give necessary relief to the affected in time, of famine, pestilence and the fcalamitiescaused by 		nature;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	e) To arrange for social and cultural functions including dance drama, theatre etc. games both indoor 		and outdoor, gymnastics, Yoga Bayam, Body- building and other physical activities for the 			entertainment and belief of members and local people;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	f) To organise rural development programme/project for the needy rural people;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	g) To help the needy student of all communities for the prosecution of the studies;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	h) To organise blood donation camp, etc. awareness camp on health, nutrition, pollution,&nbsp;		 &nbsp; &nbsp; 	superstition, Thalasimia, Cancer, HIV/AIDS disease etc. and setup charitable&nbsp;				 &nbsp; &nbsp; 	hospital, charitable dispensaries with the help qualified doctors;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	i) To organise handicraft training centre for the needy people frothier self dependent in life;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	j) To organise and setup computer &amp; vocational training centre, Rehabilitation centre,&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 	&nbsp; &nbsp; 		hostel,&nbsp; for the normal/disabled persons and supply of aids and appliances or the 			&nbsp; &nbsp; 	disabled and handicapped child/persons;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	k) To impart the develop social awareness among the literate women and men by			&nbsp; &nbsp; 	organising awareness camps;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	l) To make sanitary programme, forestry programme etc. for the development and&nbsp;			 &nbsp; 	protection of environment;&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	m) To organise free Ambulance service for the needy patients;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	n) To help the people in marriage, funeral and cremation of the dead;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">	o)To promote and encourage advancement literary, cultural &amp; educational educations;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">The object shall always remain restricted within the scope of section 4(2) of the W.B.S.R. Act 1961</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">The income and properties of the society whatsoever derived or obtained shall be applies solely toward the promotion of the object of the society and no portion thereof shall be paid to or divided amongst any of its members by way of profits.</p>\n<!-- /wp:paragraph -->','About us','','inherit','closed','closed','','96-revision-v1','','','2020-03-06 10:16:01','2020-03-06 10:16:01','',96,'http://localhost/sristiwelfare2/96-revision-v1/',0,'revision','',0),(241,1,'2020-03-06 10:18:30','2020-03-06 10:18:30'